import './homepage.css';
import '@fontsource/roboto/400.css';

function Homepage() {
  return (
    <div className="HomepageDiv" style={{
        display: "flex", 
        justifyContent: "center",
        alignItems: "center"
    }}>
        <p>
          This is the LocSnap homepage!
        </p>
    </div>
  );
}

export default Homepage;
